import React from 'react'
import './App.css'
import routes from './components/routes'
import { Routes, Route } from 'react-router-dom';
const App = () => {
  return (
    <>
    <Routes>
       <Route path="/" element={<routes />} />
       {/* <Route path="/products" element={<Products />} /> */}
    </Routes>
 </>
  )
}

export default App
